  it('should open url and verify the title', async () => {
    await browser.url('https://www.ebay.com/');
    await expect(browser).toHaveTitle('Electronics, Cars, Fashion, Collectibles & More | eBay');
  });
  it('should search for a product and verify the search text value', async () => {
    const searchInput = $('#gh-ac');
    const searchButton = $('#gh-btn');
    await searchInput.addValue('Laptop');
    await searchButton.click();
    await expect(searchInput).toHaveValue('Laptop');
  });
  it('should direct to new page and verify the title', async () => {
    await expect(browser).toHaveTitle('Laptop for sale | eBay');
  });
  it('should upadate the search category', async () => {
    const category = $('#gh-cat option:nth-child(1)');
    await expect(category).toHaveText('PC Laptops & Netbooks');
  });
});
